r.x:
var $bm_rt;
var fx = thisComp.layer('Group 2').effect('Rotation Wiggle');
var freq = fx(2);
var amp = fx(1);
var loop = fx(3);
var complexity = fx(5);
var multiplier = fx(6);
var seed = fx(7);
seedRandom(seed);
if (loop == 0)
    loop = thisComp.duration;
var t = $bm_sub($bm_mod(time, loop), loop);
var w1 = wiggle(freq, amp, complexity, multiplier, t);
var w2 = wiggle(freq, amp, complexity, multiplier, $bm_sub(t, loop));
var w = ease(t, $bm_neg(loop), 0, w1, w2);
$bm_rt = $bm_sub($bm_sum(w, value), valueAtTime(0));

